import React from "react";
import { LandingSection } from "./sections/landing";
import Navbar from "./shared/navbar";
import styled from "styled-components";

const Wrapper = styled.div`
  .nav {
    width: 50% !important;
  }
`;

function App() {
  return (
    <Wrapper>
      <Navbar className="nav" />
      <LandingSection />
    </Wrapper>
  );
}

export default App;
